import React, { Component } from 'react'

export default class ListTasks extends Component {
    constructor(props) {
        super(props)
        this.state = {
            Tasks: []
        }
    };
    componentDidMount() {
        getTasks();
    }
    getTasks = (props) => {
        (async () => {
            const rawResponse = await fetch('/tasks/', {
                method: 'GET',
                headers: {
                    'Accept': 'application/json',
                    'Content-Type': 'application/json'
                }
            });
            const response = await rawResponse.json();
            if (response != null && response.length > 0) {
                this.setState({ Tasks: response });
            }
        })();
    }
    render() {
        console.log(this.props);
        return (
            <table className="table-content table-bordered table-dark">
                <thead>
                    <tr>
                        <th>No.</th>
                        <th>Name</th>
                        <th>Type</th>
                        <th>Status</th>
                    </tr>
                </thead>
            </table>
        )
    }
}
